import React from "react";



const styles = {
  jumbotronStyle: {
    background: "green"
  }
};
const Jumbotron = () => (

    <div className="jumbotron jumbotron-fluid">
  <div class="container">
    <h1 class="display-4">A FUN CLICKY GAME</h1>
    <p class="lead">Click on an image more than once and you lose!</p>
  </div>
</div>
)


export default Jumbotron;
